import { makeObservable, observable, action, computed } from "mobx"

export class Node {
    col = 0;
    type = 0;
    row = 0;

    constructor(x, y) {
        makeObservable(this, {
            col: observable,
            type: observable,
            row: observable,
            changeType: action
        })
        this.col = x;
        this.row = y;
    }

    changeType(type) {
        this.type = type;
    }
}

